import React from "react";

function Lines ({group}) {

    var larges = []

    if (group === "Larges") {
        for (let i = 0; i < 7; i++) {
            larges.push(<li><input type="checkbox">{i}</input></li>)
            console.log(larges)
        }
    }

    return (
        <div>
            <ul className="lines">{larges}</ul>
        </div>
    )
}

export default Lines
